            let suma = 0
            note.forEach(element => {
                suma += element
                count++
            });
            let medie = suma/count
            setTema(tema)
            setSpeakerFb(Object.values(speakerFb))
            setRaport(medie)
            console.log(tema,speakerFb,raport, suma, count, medie)
        })
        .catch(err => console.log(err))
    }
    const listTemaFb = tema.map(f =>
