                {tema.map((item) => {
                return <article className='punct-item'>{item}</article>
                })}
            </div>
            <p>Cum a fost interacÈ›iunea cu speakerul?</p>
            <div className="punct-container">
                {speakerFb.map((item) => {
                return <article className='punct-item'>{item}</article>
                })}
            </div>
            <p>Cum ai nota raportul dintre  partea teoreticÄƒ È™i cea practicÄƒ?</p>
